import React from "react";
import { useState } from "react";

const Homepage = (props) => {
    const [toggle, setToggle] = useState(1);
    setInterval(() => {
        if (toggle) {
            setToggle(0);
        } else {
            setToggle(1)
        }
        console.log(toggle)
    }, 1500);
}

export default Homepage;
